import React from "react";
import logo from "./logo.svg";
import "./App.css";

import { IShoppingSale } from "./api/structures/shoppings/sales/IShoppingSale";
import ProductSection from "./components/ProductSection";
interface Props {
  sale: IShoppingSale;
}

function App({ sale }: Props) {
  console.log("sale:", Array.isArray(sale.units));
  return (
    <div className="App">
      <form>
        {sale.units.map((unit) => (
          <ProductSection key={unit.id} unit={unit} />
        ))}
      </form>
    </div>
  );
}

export default App;
